data.value:
Using a dynamic JSON object tree as a data source for cell, an example of JSON format is as follows
[
    {
        "value": 1,
        "label": "Department1",
        "children": [
            {
                "value": 2,
                "label": "Sub-department1"
            },
            {
                "value": 3,
                "label": "Sub-department2",
                "children": [
                    {
                       "value": 4,
                       "label": "Sub-department2-1"
                    }
                ]
            }
        ]
    },
    {
        "value": 5,
        "label": "Department2"
    },
    {
        "value": 6,
        "label": "Department3"
    }
]
The above data assumes that the 'value attribute' is value, the 'label attribute name' is label, and the 'children attribute name' is 'children'
Typically, a JSON data source can be obtained from a web service via an HTTP request command, or from a server-side command

